#include <stdlib.h>

int numberOfGoodPartitions(int* nums, int numsSize) {
    const int MOD = 1000000007;
    int* dp = (int*)malloc((numsSize + 1) * sizeof(int));
    int* last = (int*)malloc((1000000000 + 1) * sizeof(int));
    for (int i = 0; i <= 1000000000; i++) last[i] = -1;

    dp[numsSize] = 1; // Base case: There's 1 way to partition the empty array.
    for (int i = numsSize - 1; i >= 0; i--) {
        dp[i] = (2 * dp[i + 1]) % MOD;
        if (last[nums[i]] != -1) {
            dp[i] = (dp[i] - dp[last[nums[i]] + 1] + MOD) % MOD;
        }
        last[nums[i]] = i;
    }

    free(last);
    int result = dp[0];
    free(dp);
    return result;
}
